import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Food For Thoughts
        </p>
        <img src={logo} className="App-logo" alt="logo" />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
<button onClick={activateLasers}>
        <p>
          Food For Thoughts
        </p>
</button>
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
